- input: "TEXT\x1CC00438309\x1C.TEXT\x1C\x1CF3A\x1CIn my original October Quarterly
    report, I overlooked a folder of credit card slips and an in-kind receipt.  I
    didn't want to wait to include them in the next report, so I immediately filed
    an amendment to correct the situation and to make sure they were entered.  This
    is why there was an increase in activity between the original report and the amendment.
    \ It was an error on my part.   Regarding the excessive contributions, I mistakenly
    duplicated Janie Thomas's contribution, and designated a contribution as being
    from Norman McClelland, when it should have been from Barbara McClelland.  Senate
    Majority fund gave towards primary debt retirement, so I noted that in the description
    on the $5,000.00 contribution.  Thank you for your help on this.   Sincerely,
    Sarah Raybon       Jan. 8, 2009    ADDITIONALLY, there were several receipts mailed
    to us 1/1/09.  These were found in cleaning up a headquarters in Flagstaff.  I
    am adding these in now in a new amendment.  Thank you.  Sarah Raybon  "
